import styled from 'styled-components'

const ViewCardContainer = styled(Box)`
  display: flex;
  height: 540px;
  gap: 12px;
  border-color: #0B886D;
  border-radius: 8px;
  overflow: hidden;
  max-height: 480px;
`;

const ViewCard = () => {
    return (
      <>
        <p>Test </p>
        <ViewCardContainer/>
      </>
    );
};

export default ViewCard
